import React, {Component} from 'react';
import { LogoBnb1, LogoEbay1, LogoStripe1, LogoCapital1, LogoImb1, LogoPrudential1 } from '../components/ImageSiderBar.js';
import '../styles/siderbar.css';
import '../styles/style.css';

export default class PartnerURL extends Component {
    render(){
        return(
            <div style={{marginTop: 80}}>
                <div style={{display: 'flex', justifyContent: 'center'}}>
                    <div style={{width: '84%', display: 'flex', flexDirection: 'column'}}>
                        <div style={{display: 'flex'}}>
                            <LogoBnb1 />

                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
